   <script>



	        function plotpos(str){
	        	i = str.charCodeAt(0) - 97
	        	j = str[1] - 1
	        	plot(wk, i, j)

	        	i = str.charCodeAt(2) - 97
	        	j = str[3] - 1
	        	plot(wr, i, j)

	        	i = str.charCodeAt(4) - 97
	        	j = str[5] - 1
	        	plot(bk, i, j)
	        }

	        function plot(piece, i, j){
	        	cnv.drawImage(piece, 84*i+33, 84*(7-j)+33)
	        }

	        function drawboard(){
	        	cnv.drawImage(img, 0,0);
	        }

	        function debug(text){
	        	dbug.innerHTML = text
	        }

            clock = 0
            k = 0

            img = new Image();img.src="bg.jpg"
            wr = new Image();wr.src='wr.png'
            wk = new Image();wk.src='wk.png'
            bk = new Image();bk.src='bk.png'

            img.onload = function(){

            	canvas = document.createElement('canvas')
            	cnv = canvas.getContext('2d')
            	canvas.width = 720
            	canvas.height = 1280
            	document.body.appendChild(canvas)

            	dbug = document.createElement('h1')
            	dbug.innerHTML = "hello word"
            	document.body.appendChild(dbug)

	        	drawboard()
	        	plotpos(a[clock])
	        	debug(a[clock])


            }

            document.onkeydown = function(e){
            	k = e.keyCode
            	if (k == 33) clock +=1000
            	if (k == 34) clock -=1000
            	if (k == 38) clock +=100
            	if (k == 40) clock -=100
            	if (k == 39) clock++
            	if (k == 37) clock--

	        	if(clock>=a.length) clock = 0
	        	if(clock<0) clock = a.length-1

	        	drawboard()
	        	debug([clock, a[clock]].join(": "))
	        	plotpos(a[clock])

            	if(k==38||k==40||k==39||k==37||k==33||k==34)return false
            	//else alert(k)
            	return true
            }
